import React from 'react';
import TodoItem from './TodoItem';

function TodoList(props)  {

		return (
			<div className="todo-list-container">
				{props?.todos?.map((todo) => (
					<TodoItem todo={todo} key={todo.id} />
				))}
			</div>
		);
	}


export default TodoList;
